import React from "react";
import { Link } from "react-router-dom";
import { ReactComponent as Logo } from "../../assets/logo.svg";
import "./header.styles.scss";

const Header = () => {
  return (
    <header className="header">
      <Link to="/">
        <Logo />
      </Link>
    </header>
  );
};

export default Header;
